import React, {Component} from 'react';
import TabView from '../Components/TabView'

class Details extends Component {
    render() {
        return (
            <>
                Details + {this.props.id}
                <TabView typ={"dok"} id={this.props.id}/>
            </>
        );
    }
}

export default Details;
